import { useState } from "react";
import QuestionsData from "../data/QuestionsData"

function Quiz(){

    const [current,setCurrent] = useState(0);

    return(
        <div className="quiz">
            <h2>{QuestionsData[current].question}</h2>
            <div className="choices">
                <button onClick={setCurrent+=1}>{QuestionsData[current].A}</button>
                <button onClick={setCurrent+=1}>{QuestionsData[current].B}</button>
                <button onClick={setCurrent+=1}>{QuestionsData[current].C}</button>
                <button onClick={setCurrent+=1}>{QuestionsData[current].D}</button>
            </div>
        </div>
    )
}

export default Quiz
